import React from 'react'
import logo from '../images/f4831953b8cb4d9e9fe8411b179c2a11__1_-removebg-preview (1).png'
import { Link } from 'react-router-dom'
const Navbar = () => {
  return (
    <div>
        <nav className='bg-bgDark py-2'>
           <Link></Link> <img src={logo} height='30px' width="200px"></img>
        </nav>
    </div>
  )
}

export default Navbar
